static  int  is_in_gb2312_d1212s_class_2_block(const TCHAR *code)
{
    UINT16  tcode = ( ((unsigned char)code[0]&0xFF) << 8 ) | ((unsigned char)code[1]&0xFF);   

    if ( tcode < 0xD8A1 )
        return  -1;

    if ( tcode > 0xF7FE )
        return  -1;

    return  1;
}

static  unsigned int  get_gb2312_d1212s_class_2_index(const TCHAR *code)
{
    unsigned int  index = ( ((unsigned char)code[0] - 0xD8)*94 + ((unsigned char)code[1] - 0xA1) )*18;

    if ( index > 54126 )
        index = 54126;

    return  index;
}

