static  int  is_in_gb2312_d1212s_symbol_block(const TCHAR *code)
{
    UINT16  tcode = ( ((unsigned char)code[0]&0xFF) <<  8 ) | ((unsigned char)code[1]&0xFF);   

    if ( tcode < 0xA1A1 )
        return  -1;

    if ( tcode > 0xA9FE )
        return  -1;


    return  1;
}

static unsigned int  get_gb2312_d1212s_symbol_index(const TCHAR *code)
{
    unsigned int  index = ( ((unsigned char)code[0] - 0xA1)*94 + ((unsigned char)code[1] - 0xA1) )*18;

    if ( index > 15210 )
        index = 15210;

    return  index;
}

